  return (
    <div className={styles.App}>
     <BrowserRouter>
     <Switch>
      <Route path='/' exact component={HomePage}/>
      <Route path='/signin' render={()=><h1>登陆</h1>}/>
      <Route render={()=><h1>404 not found</h1>}></Route>
      </Switch>
     </BrowserRouter>
    </div>

  );
}

export default App;
